[{'node': {'text': "Prepariamoci a riscoprire i capolavori novecenteschi della GAM da una prospettiva inedita: la Galleria rinnova l'allestimento delle sue collezioni permanenti del XXI secolo con un nuovo percorso appena aperto al pubblico.
üèõ
Il nuovo allestimento, suddiviso in diciannove spazi, punta a restituire centralit√† alle opere d'arte, permettendo il necessario confronto tra le sequenze di dipinti, sculture, installazioni, affiancati da poche informazioni essenziali. 
Dopo una necessaria premessa dedicata a de Chirico, Morandi e de Pisis ‚Äì tre delle figure che maggiormente hanno influito sulla principale arte italiana e internazionale del XXI secolo ‚Äì ci attende un ordinamento che, sala dopo sala, ripercorre alcune fasi fondamentali della storia dell'arte novecentesca. Tra i capolavori esposti lungo il percorso potremo ritrovare le opere di grandissimi artisti italiani e internazionali, tra i quali: Umberto Boccioni, Giacomo Balla, Max Ernst, Paul Klee, Francis Picabia, Alberto Burri, Lucio Fontana, Marc Chagall, Pablo Picasso, Jean Arp, Piero Manzoni, Louise Nevelson, Yves Klein e Andy Warhol. 
A conclusione del nuovo allestimento, inoltre, una sezione interamente dedicata all'esperienza dell'Arte Povera, approdata per la prima volta in un museo proprio alla GAM nel 1970.
üñº
Ingresso gratuito per tutti i possessori dell'Abbonamento Musei Piemonte Valle d'Aosta! 
#FocusAMP
